●柄にかわいい動物（ヒヨコ）が付いています。お子様と楽しく歯みがきが出来ます。<br>●水だけでも磨ける歯ブラシです。お子様におすすめです。毛にイオン＆抗菌効果のある特殊毛を使用。ブラシも口内も清潔！<br>JAN:4571179212083<br><br>CS：180<p>CA-9 クリスタルアニマルズ 仕上げ磨き用 ヒヨコ やわらかめ<br>色はお選びいただけません。<br><br>グリップにかわいい動物（ヒヨコ）が付いています。<br>お子様と楽しく歯みがきが出来ます。<br>水だけでも磨ける歯ブラシです。お子様におすすめです。<br>毛にイオン＆抗菌効果のある特殊毛を使用。抗菌効果で使用中も使用後も衛生的です。<br>大腸菌、黄色ぶどう球菌、りょくのう菌に対して抗菌効果があります。<br>やわらかめ毛を使用した、超コンパクトヘッド仕上げ磨き用歯ブラシです。 <br>対象年齢０．５才～３才位。<br><br>使用方法<br>万一のケガ防止のため、必ず大人の方が歯ブラシをお持ちになり、ご一緒にお子様の歯を磨いて下さい。<br>歯に磨き残しがないか確認をしながら、軽くブラッシングをして下さい。<br>使用上の注意<br>強く磨くと、汚れが落ちにくいだけでなく、歯や歯グキを傷める原因にもなります。<br>歯ミガキ以外には使用しないで下さい。<br>　<br>保管及び取扱い上の注意<br>熱湯消毒や紫外線殺菌機などのご使用はお避け下さい。<br>変形などの恐れがあります。<br>ご使用後は流水で歯ブラシを十分に洗い、水気をよく切り、お子様の手の届かない、風通しの良い所に保管して下さい。<br>　</p><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
